import React, { useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { FaChartLine, FaFileAlt, FaUsers, FaMoon, FaSun } from 'react-icons/fa';
import { motion } from 'framer-motion';

const MinistereHome = () => {
  const navigate = useNavigate();
  const [darkMode, setDarkMode] = useState(false);

  const handleLogout = () => {
    localStorage.removeItem('token');
    localStorage.removeItem('user');
    navigate('/login');
  };

  return (
    <div className={`min-h-screen transition-colors duration-300 ${darkMode ? 'bg-gray-900 text-gray-100' : 'bg-gradient-to-r from-blue-100 via-blue-200 to-blue-300'}`}>
      {/* Bouton Mode Sombre/Clair en haut Ã  droite */}
      <button
        onClick={() => setDarkMode(!darkMode)}
        className={`absolute top-6 right-6 p-3 rounded-full ${darkMode ? 'bg-yellow-400 text-gray-900' : 'bg-gray-800 text-white'}`}
      >
        {darkMode ? <FaSun size={20} /> : <FaMoon size={20} />}
      </button>

      {/* Bouton DÃ©connexion en haut Ã  gauche */}
      <button
        onClick={handleLogout}
        className={`absolute top-6 left-6 flex items-center gap-2 ${darkMode ? 'bg-red-700 hover:bg-red-800' : 'bg-red-600 hover:bg-red-700'} text-white px-4 py-2 rounded-lg transition-colors`}
      >
        DÃ©connexion
      </button>

      <div className="flex flex-col items-center p-6 pt-20">
        <motion.h1 
          initial={{ opacity: 0, y: -20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.5 }}
          className={`text-4xl font-bold mb-8 ${darkMode ? 'text-white' : 'text-blue-900'}`}
        >
          Espace MinistÃ¨re
        </motion.h1>

        <div className="grid grid-cols-1 md:grid-cols-3 gap-8 w-full max-w-3xl">
          {/* Lien vers le Dashboard */}
          <motion.div
            whileHover={{ scale: 1.05 }}
            whileTap={{ scale: 0.95 }}
          >
            <Link 
              to="/dashboard/ministere" 
              className={`block rounded-xl shadow-lg p-8 flex flex-col items-center transition ${darkMode ? 'bg-gray-800 hover:bg-gray-700' : 'bg-white hover:bg-blue-50'}`}
            >
              <FaChartLine className={`text-3xl mb-2 ${darkMode ? 'text-blue-400' : 'text-blue-600'}`} />
              <span className={`text-2xl font-semibold mb-2 ${darkMode ? 'text-white' : 'text-blue-700'}`}>Dashboard</span>
              <span className={`text-center ${darkMode ? 'text-gray-300' : 'text-gray-600'}`}>Tableau de bord complet avec statistiques</span>
            </Link>
          </motion.div>
          
          {/* Lien vers la crÃ©ation d'offres */}
          <motion.div
            whileHover={{ scale: 1.05 }}
            whileTap={{ scale: 0.95 }}
          >
            <Link 
              to="/dashboard/ministere/creer-offre" 
              className={`block rounded-xl shadow-lg p-8 flex flex-col items-center transition ${darkMode ? 'bg-gray-800 hover:bg-gray-700' : 'bg-white hover:bg-blue-50'}`}
            >
              <FaFileAlt className={`text-3xl mb-2 ${darkMode ? 'text-green-400' : 'text-green-600'}`} />
              <span className={`text-2xl font-semibold mb-2 ${darkMode ? 'text-white' : 'text-blue-700'}`}>CrÃ©er Offre</span>
              <span className={`text-center ${darkMode ? 'text-gray-300' : 'text-gray-600'}`}>Publier de nouvelles offres d'emploi</span>
            </Link>
          </motion.div>
          
          {/* Lien vers la gestion des candidatures */}
          <motion.div
            whileHover={{ scale: 1.05 }}
            whileTap={{ scale: 0.95 }}
          >
            <Link 
              to="/dashboard/ministere/candidatures" 
              className={`block rounded-xl shadow-lg p-8 flex flex-col items-center transition ${darkMode ? 'bg-gray-800 hover:bg-gray-700' : 'bg-white hover:bg-blue-50'}`}
            >
              <FaUsers className={`text-3xl mb-2 ${darkMode ? 'text-purple-400' : 'text-purple-600'}`} />
              <span className={`text-2xl font-semibold mb-2 ${darkMode ? 'text-white' : 'text-blue-700'}`}>Candidatures</span>
              <span className={`text-center ${darkMode ? 'text-gray-300' : 'text-gray-600'}`}>GÃ©rer les candidatures reÃ§ues</span>
            </Link>
          </motion.div>
        </div>
      </div>
    </div>
  );
};

export default MinistereHome;
